INSERT INTO `aws_product` (`ID`, `PRODUCTID`, `CATID`, `DESCRIPTION`, `PRICE`, `STOCK`, `FRONTPAGE`, `NEW`, `FEATURES`, `WEIGHT`) VALUES
(2, 'Aloo Chaat', 5, '<font face="sans-serif" size="2"><span style="line-height: 19.200000762939453px"><strong>Aloo Chaat (Hindi: &#39;&#2310;&#2354;&#2370; &#2330;&#2366;&#2335;&#39;) is the name of a street food item made in North India. It is prepared by frying potatoes in oil and adding spices and chutney.</strong></span></font>', 3.99, 0, 1, 0, '', 500),
(3, 'Aloo tikki', 5, '<font face="sans-serif" size="2"><span style="line-height: 19.200000762939453px"><strong>Aloo tikki is a North Indian snack made of boiled potatoes and various spices. &quot;Aloo&quot; means potato, and the word &quot;tikki&quot; means a small cutlet orcroquette. It is found in almost every chaat shop or stall in Delhi as well as in other parts of India. It is served hot along with saunth, tamarind andcoriander-mint chutney (sauce), known as Hari chutney, and sometimes yogurt or chick peas.</strong></span></font>', 4.99, 10, 0, 0, '', 450),
(4, 'Mullu Murukku', 4, '"A rose by any other name would smell just as sweet", so does a Mullu Murukku. This South Indian savory made from rice and lentil flour by any other name (and it has quite a lot) would taste just as crispy, crunchy and addictive. Also known as "Magizhampoo", "Muthusaram", "Manakombu" and "Mullu Thenkuzhal"', 3.99, 100, 1, 0, '', 500),
(5, 'Thenkuzhal murukku', 4, '<span style="font-family: verdana, arial, sans-serif; font-size: 13px; line-height: 18.200000762939453px">Famous south indian snack made with rice flour and split black gram (ulundu). (Rice chakli / Janthikalu)</span>', 4.99, 99, 0, 0, '', 500),
(6, 'Chhena jalebi', 3, '<font face="sans-serif" size="2"><span style="line-height: 19.200000762939453px"><strong>Chhena jalebi is a sweet dish originally from coastal Orissa in eastern India, a state known for desserts made of chhena. Its popularity has spread beyond coastal Orissa. It is also made in modern day Bangladesh</strong></span></font>', 4.99, 98, 1, 0, '', 500),
(7, 'Pitha', 3, '<font face="sans-serif" size="2"><span style="line-height: 19.200000762939453px"><strong>Pitha (Oriya: &#2858;&#2879;&#2848;&#2878;, Assamese: &#2474;&#2495;&#2464;&#2494;, Bengali: &#2474;&#2495;&#2464;&#2494; pi&#7789;ha, ), (Sanskrit: &#2346;&#2367;&#2359;&#2381;&#2335;&#2366;, &#2309;&#2346;&#2370;&#2346;) or pithe (Bengali: &#2474;&#2495;&#2464;&#2503; pi&#7789;he) is a type of cake, dimsum or breadcommon in Bangladesh and India, especially the eastern states of Assam, Odisha, West Bengal, Bihar, Jharkhand, and the northeastern region. Pithas are typically made of rice flour, although there are some types of pitha made of wheat flour. Less common types of pitha are made of palmor ol (a local root vegetable).</strong></span></font>', 4.99, 99, 0, 0, '', 500),
(8, 'Adhirasam', 2, '<font face="sans-serif" size="2"><span style="line-height: 19.200000762939453px"><strong>Adhirasam (Tamil: &#2949;&#2980;&#3007;&#2992;&#2970;&#2990;&#3021;) is a type of Indian sweet from Tamil cuisine. The doughnut like pastry has a long history of popularity in Tamil civilization. They are similar in shape to vadai, but are not savoury and are eaten as a dessert.</strong></span></font>', 4.99, 10, 0, 0, '', 500),
(9, 'Kozhukkattai', 2, '<font face="sans-serif" size="2"><span style="line-height: 19.200000762939453px"><strong>Kozhakkatta (Tamil: &#2965;&#3018;&#2996;&#3009;&#2965;&#3021;&#2965;&#2975;&#3021;&#2975;&#3016;, Malayalam: &#3349;&#3402;&#3380;&#3393;&#3349;&#3405;&#3349;&#3359;&#3405;&#3359;, Marathi: &#2350;&#2378;&#2342;&#2325;, Oriya: &#2862;&#2851;&#2893;&#2849;&#2878; manda) is a popular Indian sweet dumpling made fromrice flour, grated coconut and jaggery, and is similar to Modak made in other parts of India. This dish is popularly associated with Lord Ganesh andGanesh Chaturti celebrations in South India. The dish is also a part of the traditional Nasrani cuisine of the Syrian Christians of the state ofKerala</strong></span></font>', 4.99, 100, 0, 0, '', 500),
(10, 'Dosa', 6, '<font face="sans-serif" size="2"><span style="line-height: 19.200000762939453px"><strong>Dosa (Kannada: &#3238;&#3275;&#3256;&#3270;, Tamil: &#2980;&#3019;&#2970;&#3016;,Telugu: &#3110;&#3147;&#3128;,Malayalam: &#3366;&#3403;&#3382;,Sinhala: &#3501;&#3549;&#3523;&#3546;), is a fermented crepe or pancake made from rice batterand black lentils. This staple dish is widely popular in all southern Indian states Karnataka, Andhra Pradesh, Tamil Nadu and Kerala, as well as being popular in other countries like Sri Lanka, Malaysia and Singapore</strong></span></font>', 4.99, 99, 1, 0, '', 500),
(11, 'Idli', 6, '<font face="sans-serif" size="2"><span style="line-height: 19.200000762939453px"><strong>Idli (Tamil: &#2951;&#2975;&#3021;&#2994;&#3007;, Kannada: &#3207;&#3233;&#3277;&#3250;&#3263;, Telugu: &#3079;&#3105;&#3149;&#3122;&#3135;, Malayalam: &#3335;&#3361;&#3405;&#3378;&#3391;), also romanized idly or iddly, plural idlis, is a traditional breakfast in south Indian households. Idli is savory cake of South India that is most popular throughout the southern part of India including Karnataka, Tamil Nadu, Pondicherry, Kerala, Andhra Pradesh and neighbouring countries like Sri Lanka. The cakes are usually two to three inches in diameter and are made by steaming a batter consisting of fermented black lentils (de-husked) and rice. The fermentation process breaks down the starches so that they are more readily metabolized by the body.</strong></span></font>', 4.99, 100, 0, 0, '', 500),
(12, 'Bisi Bele Bath', 7, 'Bisi bele bhath (Kannada: &#3244;&#3263;&#3256;&#3263; &#3244;&#3271;&#3251;&#3270; &#3245;&#3262;&#3236;&#3277; bisi b&#275;le bh&#257;t) is a rice-based dish with its origins in the state of Karnataka, India. Bisi-bele-bhaathtranslates to hot lentil rice in the Kannada language. It is also known as Bisi bele huliyanna (Kannada: &#3244;&#3263;&#3256;&#3263; &#3244;&#3271;&#3251;&#3270; &#3257;&#3265;&#3251;&#3263; &#3205;&#3240;&#3277;&#3240;), which means &quot;hot lentil sour rice&quot;. The traditional preparation of this dish is quite elaborate and involves the use of spicy masala, toor dal (a type of lentil) and vegetables. Spices like nutmeg and asafoetida, curry leaves and tamarind pulp used in its preparation contribute to the unique flavour and taste of this dish. It is served hot and sometimes eaten along with salad, papad or potato chips. This dish is commonly found in restaurants that serve the Udupi cuisine. Themasala used for the dish is available off the shelf.', 4.99, 100, 0, 0, '', 500),
(13, 'Chicken Biriyani', 7, '<font face="sans-serif" size="2"><span style="line-height: 19.200000762939453px">Biryani, biriani, biriyani, buriyani, beryani or beriani is a rice-based dish (usually using basmati) made with spices and chicken,mutton, fish, eggs or vegetables. The name is derived from the Persian word bery&#257;(n) (&#1576;&#1585;&#1740;&#1575;&#1606;), meaning &quot;fried, roasted&quot;. It was originated in Turkey or Persia and brought to India by Muslim travellers and merchants and Mughal. It was one of the most famous dishes in the kitchen of the Mughal Emperors. It is very popular in South Asia and is a key element of the South Asian cuisine. Hyderabad, Malabar, Delhi/Agra, Dhaka, Kashmir, Kolkata,Lucknow and Lahore, are the main centres of biryani cuisine. Biryani was traditionally prepared in earthenware pots and is known for its unique aroma, flavour and spices</span></font>', 4.99, 99, 0, 0, '', 500);
